import React from 'react';
import { Box, Container, Grid, Typography, Card, CardMedia, CardContent, Button } from '@mui/material';
import { motion } from 'framer-motion';

const Gallery = () => {
  const galleries = [
    {
      title: 'Wedding Collection',
      image: 'https://source.unsplash.com/800x600/?wedding',
      photos: '245 photos',
      date: 'March 2025'
    },
    {
      title: 'Portrait Session',
      image: 'https://source.unsplash.com/800x600/?portrait',
      photos: '124 photos',
      date: 'March 2025'
    },
    {
      title: 'Event Coverage',
      image: 'https://source.unsplash.com/800x600/?event',
      photos: '180 photos',
      date: 'March 2025'
    }
  ];

  return (
    <Box sx={{ py: 8 }}>
      <Container maxWidth="lg">
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
        >
          <Typography variant="h3" component="h1" gutterBottom align="center">
            Client Galleries
          </Typography>
          <Typography variant="h6" color="textSecondary" align="center" sx={{ mb: 6 }}>
            Beautiful and secure galleries to showcase your work
          </Typography>

          <Grid container spacing={4}>
            {galleries.map((gallery, index) => (
              <Grid item xs={12} md={4} key={index}>
                <motion.div
                  initial={{ opacity: 0, y: 20 }}
                  animate={{ opacity: 1, y: 0 }}
                  transition={{ duration: 0.8, delay: index * 0.2 }}
                >
                  <Card sx={{ 
                    height: '100%',
                    display: 'flex',
                    flexDirection: 'column',
                    '&:hover': {
                      transform: 'translateY(-8px)',
                      transition: 'transform 0.3s ease-in-out'
                    }
                  }}>
                    <CardMedia
                      component="img"
                      height="300"
                      image={gallery.image}
                      alt={gallery.title}
                      sx={{ objectFit: 'cover' }}
                    />
                    <CardContent>
                      <Typography variant="h6" gutterBottom>
                        {gallery.title}
                      </Typography>
                      <Typography variant="body2" color="textSecondary">
                        {gallery.photos} â€¢ {gallery.date}
                      </Typography>
                    </CardContent>
                  </Card>
                </motion.div>
              </Grid>
            ))}
          </Grid>

          <Box sx={{ mt: 8, textAlign: 'center' }}>
            <Button
              variant="contained"
              color="primary"
              size="large"
              sx={{
                borderRadius: 2,
                textTransform: 'none',
                px: 4,
                py: 1.5
              }}
            >
              Create New Gallery
            </Button>
          </Box>
        </motion.div>
      </Container>
    </Box>
  );
};

export default Gallery;
